import React from 'react';
import SmallCard from './SmallCard';

/*  Cada set de datos es un objeto literal */

/* <!-- Movies in DB --> */

let total_produductos = {
    title: 'Total Productos',
    color: 'primary',
    cuantity: 21,
    icon: "fa-book"
}

/* <!-- Total awards --> */

let total_usuarios = {
    title: ' Total Usuarios',
    color: 'success',
    cuantity: '79',
    icon: 'fa-user-check'
}

/* <!-- Actors quantity --> */

let total_categorias = {
    title: 'Total Categorias',
    color: 'warning',
    cuantity: '49',
    icon: 'fa-award'
}

let cartProps = [total_produductos, total_usuarios, total_categorias];

function ContentRowMovies() {
    return (

        <div className="row">

            {cartProps.map((movie, i) => {

                return <SmallCard {...movie} key={i} />

            })}

        </div>
    )
}

export default ContentRowMovies;
